import useFetch from "./useFetch";

const Recipes = () => {
  const { error, isPending, data: food } = useFetch('http://localhost:5000/recipes');

  const handleSearch = () =>{
    console.log('heelo')
  }

  return (
    <div className="home">
      <h1 style={{ textAlign: 'center' }}> Food Recipes</h1>
      {error && <div>{error}</div>}
      {isPending && <div>Loading...</div>}

      <button onClick={handleSearch}>Search a blog </button>
      {food && <BlogList blogs={food} category="recipes" />}
    </div>
  );
}

